import { Button } from '../Button/Button';
import styles from './ToDoItem.module.css';

interface IProps {
  text: string;
  index: number;
  onDelete: () => void;
  onComplete: () => void;
}
export const ToDoItem = ({ text, index, onDelete, onComplete }: IProps) => {
  return (
    <div className={styles.wrapper}>
      <Button
        className={styles.buttonOnComplete}
        text='&#10004;'
        onClick={onComplete}
      />
      <p className={styles.todoText}>
        <p className={styles.todoIndex}>{index + 1}</p>
        {text}
      </p>
      <Button
        className={styles.buttonOnDelete}
        text='&#10006;'
        onClick={onDelete}
      />
    </div>
  );
};
